    openUrl(index) {
      switch (index) {
        case 1:
          const base_url = process.env.VUE_APP_IS_APP ? this.$store.state.multiItem[process.env.VUE_APP_ITEM_NAME].app_url : location.origin;
          location.href = base_url + "/ww";
          break;
        case 2:
          this.$router.push('/customerService');
          break;
